import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";

function App() {
  return(
   <Router>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route exact path="/start">
            <Start />
          </Route>
          <Route exact path="/enter">
            <Enter />
          </Route>
          <Route exact path="/home">
            <Redirect to="/start" />
          </Route>
          <Route exact path="/">
            <Redirect to="/start" />
          </Route>
          <Route path="*">
            <NotFound />
          </Route>

        </Switch>
    </Router>
  );
}

function Start(){
  return(
    <h1>Start</h1>
    );
}

function Enter(){
  return(
    <h1>Enter</h1>
    );
}

function NotFound(){
  return(
    <h1>Not Found</h1>
    );
}
export default App;
